import React from "react";
import { Link } from "react-router-dom";
const LINKS = [
  { to: "/", text: "Home" },
  { to: "/starred", text: "Starred" },
];
const Nav = () => {
  return (
    <div>
      <ul>
        {LINKS.map((item) => (
          <li key={item.to}>
            {" "}
            <Link to={item.to}>{item.text}</Link>
          </li>
        ))}
        <li>
          <Link to="/starred">Go to starred page</Link>
        </li>
      </ul>
    </div>
  );
};

export default Nav;
